import React from 'react';
import './matchData.css';
import { Container, Grid, Segment, Divider, Button, Icon, Image, Item, Label } from 'semantic-ui-react';

const paragraph = <Image src='/images/wireframe/short-paragraph.png' />

const MatchData = () => ( 
    <Container style={{background: 'white', margin: '80px'}}>
        <div>
            <Segment textAlign='center'>Right aligned content.</Segment>
            <Segment textAlign='center'>Left aligned content.</Segment>
            <Segment textAlign='center'>Center aligned content.</Segment>
        </div>
    </Container>
)

export default MatchData;
